import "../styles/banner.css";

export function Banner() {
  return (
    <div className="banner container-md shadow">
      <div className="d-flex flex-column align-items-center justify-content filtro">
        <h1 className="text-light">Helados Artesanales</h1>
        <a
          href="sabores.html"
          className="h4 text-light text-decoration-none"
        >
          Lista de Sabores <i className="fas fa-forward arrow"></i>
        </a>
      </div>
    </div>
  );
}
